import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

interface AllLogFiles {
  logFileID: number;
  logFileName: string;
  logFilePath: string;
  changed: string;
}

const Table = styled.table`
  width: 100%;
  border-collapse: collapse;
  margin-top: 20px;
`;

const Th = styled.th`
  background-color: #f2f2f2;
  padding: 12px;
  text-align: left;
  border-bottom: 2px solid #ddd;
`;

const Td = styled.td`
  padding: 12px;
  border-bottom: 1px solid #ddd;
`;

const StyledLink = styled(Link)`
  text-decoration: none;
  color: #007bff;
  &:hover {
    text-decoration: underline;
  }
`;

export const ListLogFiles = () => {
  const [allLogFiles, setAllLogFiles] = useState<AllLogFiles[]>([]);
  const [error, setError] = useState<string | null>(null);

  const fetchLogFiles = async () => {
    try {
      const response = await fetch("/logFile/listLogFiles", {
        method: "GET",
        headers: {
          "Content-Type": "application/json",
        },
      });
      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      const data = await response.json();
      setAllLogFiles(data);
      setError(null);
    } catch (error) {
      console.error("Error fetching log files:", error);
      setError("Failed to fetch log files. Please try again later.");
    }
  };

  useEffect(() => {
    fetchLogFiles();
  }, []);

  useEffect(() => {
    console.log(allLogFiles);
  }, [allLogFiles]);

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div>
      <h2>Log Files</h2>
      {error && <div style={{ color: "red" }}>{error}</div>}
      {allLogFiles.length === 0 ? (
        <p>No log files found.</p>
      ) : (
        <Table>
          <thead>
            <tr>
              <Th>#</Th>
              <Th>File Name</Th>
              <Th>File Path</Th>
              <Th>Date Changed</Th>
            </tr>
          </thead>
          <tbody>
            {allLogFiles.map((logFile, index) => (
              <tr key={logFile.logFileID}>
                <Td>{index + 1}</Td>
                <Td>
                  <StyledLink to={`/logfile/${logFile.logFileID}`}>
                    {logFile.logFileName}
                  </StyledLink>
                </Td>
                <Td>{logFile.logFilePath}</Td>
                <Td>{new Date(logFile.changed).toLocaleDateString()}</Td>
              </tr>
            ))}
          </tbody>
        </Table>
      )}
    </div>
  );
};
